    - "01 Agricultura, ganader\xC3\xADa, caza y servicios relacionados con las mismas\n\
      Esta divisi\xC3\xB3n incluye dos actividades fundamentales, la producci\xC3\xB3n agr\xC3\xADcola y la producci\xC3\xB3n animal, incluyendo\n\
      asimismo la agricultura org\xC3\xA1nica, el cultivo de productos agrarios modificados gen\xC3\xA9ticamente y la cr\xC3\xADa de animales\n\
      modificados gen\xC3\xA9ticamente. Esta divisi\xC3\xB3n incluye la producci\xC3\xB3n agr\xC3\xADcola tanto en superficies a cielo abierto como en\n\
      invernaderos.\n\
      Esta divisi\xC3\xB3n incluye tambi\xC3\xA9n los servicios de apoyo a la agricultura, as\xC3\xAD como la caza, la captura de animales y las\n\
      actividades relacionadas con las mismas.\n\
      El grupo 01.5 (Producci\xC3\xB3n agr\xC3\xADcola combinada con la producci\xC3\xB3n ganadera) se aparta de los principios habituales de\n\
      determinaci\xC3\xB3n de la actividad principal. En \xC3\xA9l se acepta que muchas explotaciones agrarias tienen una producci\xC3\xB3n\n\
      agr\xC3\xADcola y ganadera razonablemente equilibrada y que ser\xC3\xADa arbitrario clasificarlas en una categor\xC3\xADa u otra.\n\
      Las actividades agrarias excluyen  cualquier elaboraci\xC3\xB3n posterior de los productos agrarios [clasificada en las\n\
      divisiones 10 y 11 (Industrias de la alimentaci\xC3\xB3n y las bebidas), y 12 (Industria del tabaco)], aparte de la que resulta\n\
      necesaria para prepararlos para los mercados primarios. Se incluye en este apartado la preparaci\xC3\xB3n de productos\n\
      para los mercados primarios.\n\
      La divisi\xC3\xB3n excluye los trabajos de construcci\xC3\xB3n para la preparaci\xC3\xB3n de terrenos (por ejemplo, el abancalamiento, el\n\
      drenaje, la preparaci\xC3\xB3n de arrozales, etc.), clasificada en la secci\xC3\xB3n F (Construcci\xC3\xB3n), y los compradores y\n\
      asociaciones cooperativas que se dedican a la comercializaci\xC3\xB3n de productos agrarios clasificados en la secci\xC3\xB3n G.\n\
      Excluye tambi\xC3\xA9n el mantenimiento y cuidado de jardines, clasificado en la clase 81.30 (Actividades de jardiner\xC3\xADa).\n"
