    - "03 Pesca y acuicultura\n\
      Esta divisi\xC3\xB3n comprende la pesca y la acuicultura, y cubre la utilizaci\xC3\xB3n de los recursos pesqueros de los medios\n\
      marinos, de aguas salobres o agua dulce, con el fin de capturar o recolectar peces, crust\xC3\xA1ceos, moluscos y otros\n\
      organismos y productos del mar (por ejemplo, plantas acu\xC3\xA1ticas, perlas, esponjas, etc.).\n\
      Incluye tambi\xC3\xA9n las actividades que est\xC3\xA1n integradas normalmente en el proceso de producci\xC3\xB3n por cuenta propia\n\
      (por ejemplo, el injerto de ostras para la producci\xC3\xB3n de perlas). En las actividades relacionadas con la pesca o la\n\
      acuicultura se incluyen los servicios relacionados con la pesca marina, de agua dulce o la acuicultura.\n\
      Esta divisi\xC3\xB3n no incluye la construcci\xC3\xB3n y reparaci\xC3\xB3n de barcos (30.1, 33.15), ni la pesca deportiva o recreativa\n\
      (93.19). Se excluye la elaboraci\xC3\xB3n de pescados, crust\xC3\xA1ceos y moluscos, tanto en instalaciones en tierra como en\n\
      buques factor\xC3\xADa (10.20).\n"
