      palangres o trampas fijas. Tales actividades pueden realizarse en la l\xC3\xADnea de costa intermareal (por ejemplo, la\n\
      captura de moluscos como los mejillones y las ostras) o instalando redes en la costa, o bien con peque\xC3\xB1as\n\
      embarcaciones o utilizando grandes buques pesqueros, tanto en aguas de bajura o costeras como de altura. Tales\n\
      actividades incluyen tambi\xC3\xA9n la pesca en masas de agua repobladas.\n"
