    - "03.2 Acuicultura\n\
      Este grupo comprende la acuicultura (o piscicultura), es decir, el proceso de producci\xC3\xB3n que incluye el cultivo o la\n\
      cr\xC3\xADa (incluida la recogida) de organismos acu\xC3\xA1ticos (peces, moluscos, crust\xC3\xA1ceos, plantas, cocodrilos, caimanes y\n\
      anfibios) con t\xC3\xA9cnicas encaminadas a aumentar, por encima de las capacidades naturales del medio, la\n\
      producci\xC3\xB3n de los organismos en cuesti\xC3\xB3n; (por ejemplo, manteniendo unas condiciones id\xC3\xB3neas estables,\n\
      suministrando una alimentaci\xC3\xB3n adecuada o proporcionando protecci\xC3\xB3n contra los predadores).\n\
      El cultivo/la cr\xC3\xADa se refieren al cultivo hasta la fase juvenil y/o adulta en cautividad de los organismos citados.\n\
      Adem\xC3\xA1s, \xE2\x80\x9Cacuicultura\xE2\x80\x9D comprende tambi\xC3\xA9n la propiedad privada o p\xC3\xBAblica de los organismos individuales a lo largo\n\
      de toda la fase de cultivo o cr\xC3\xADa y el momento de su recogida.\n"
