      de pozos de petr\xC3\xB3leo y en yacimientos de minerales met\xC3\xA1licos y no met\xC3\xA1licos. Otros servicios habituales son las\n\
      obras de cimentaci\xC3\xB3n de pozos de petr\xC3\xB3leo y gas, la cementaci\xC3\xB3n de tuber\xC3\xADas de revestimiento de pozos de petr\xC3\xB3leo\n\
      y gas, la limpieza, achique y pistoneo de pozos de petr\xC3\xB3leo y gas, el drenaje y bombeo de minas, la retirada de\n\
      sobrecargas en minas, etc.\n"
