    - "10 Industria de la alimentaci\xC3\xB3n\n\
      Esta divisi\xC3\xB3n comprende la transformaci\xC3\xB3n de los productos de la agricultura, la silvicultura y la pesca en alimentos\n\
      para las personas y animales, as\xC3\xAD como la producci\xC3\xB3n de diversos productos intermedios que no constituyen\n\
      exactamente productos alimenticios. La actividad con frecuencia genera productos asociados de mayor o menor\n\
      valor (como pieles procedentes de mataderos, o tortas de aceite, de la producci\xC3\xB3n de aceite).\n\
      La presente divisi\xC3\xB3n se organiza por actividades relacionadas con distintos tipos de productos: carne, pescado,\n\
      frutas y hortalizas, grasas y aceites, productos l\xC3\xA1cteos, productos de moliner\xC3\xADa, , otros productos alimenticios y\n\
      productos para la alimentaci\xC3\xB3n animal. La producci\xC3\xB3n puede realizarse por cuenta propia o por cuenta de terceros,\n\
      como la matanza por encargo.\n\
      Esta divisi\xC3\xB3n no comprende la preparaci\xC3\xB3n de comidas aptas para su consumo inmediato, como la que se realiza en\n\
      restaurantes.\n\
      Determinadas actividades se consideran pertenecientes a la industria manufacturera (por ejemplo, las efectuadas en\n\
      panader\xC3\xADas, pasteler\xC3\xADas y establecimientos de productos c\xC3\xA1rnicos etc., que venden su propia producci\xC3\xB3n), aunque se\n\
      realice venta al por menor de los productos en el establecimiento de los productores. Sin embargo, cuando la\n\
      elaboraci\xC3\xB3n es m\xC3\xADnima y no da como resultado una verdadera transformaci\xC3\xB3n, la unidad se clasifica como comercio\n\
      al por mayor o comercio al por menor en la secci\xC3\xB3n G.\n\
      La preparaci\xC3\xB3n de alimentos para el consumo inmediato en el establecimiento, se clasifica en la divisi\xC3\xB3n 56\n\
      (Servicios de comidas y bebidas).\n\
      La producci\xC3\xB3n de productos para la alimentaci\xC3\xB3n de animales a partir de residuos o subproductos de los mataderos\n\
      se clasifica en 10.9, mientras que la transformaci\xC3\xB3n de residuos de productos alimenticios y bebidas en materia\n\
      prima secundaria se clasifica en 38.3, y la eliminaci\xC3\xB3n de residuos de productos alimenticios y bebidas, en 38.21.\n"
