    - "13.10 Preparaci\xC3\xB3n e hilado de fibras textiles\n\
      Esta clase comprende las operaciones preparatorias sobre fibras textiles y el hilado de fibras textiles. Esta tarea\n\
      puede realizarse a partir de diversas materias primas, como la seda, la lana, otras fibras animales, vegetales o\n\
      artificiales y sint\xC3\xA9ticas, papel, vidrio, etc.\n\
      Esta clase comprende:\n\
      - las operaciones preparatorias de fibras textiles:\n\
      \xE2\x80\xA2 devanado y lavado de la seda;\n\
      \xE2\x80\xA2 desuardado y carbonizado de la lana y te\xC3\xB1ido de vellones;\n\
      \xE2\x80\xA2 cardado y peinado de todo tipo de fibras animales, vegetales y artificiales y sint\xC3\xA9ticas;\n\
      - hilado y fabricaci\xC3\xB3n de filamento o hilo para tejer o coser, para su comercializaci\xC3\xB3n o para un tratamiento ulterior;\n\
      \xE2\x80\xA2 espadado del lino;\n\
      \xE2\x80\xA2 texturado, torsi\xC3\xB3n, plegado, cableado e inmersi\xC3\xB3n de filamentos sint\xC3\xA9ticos y artificiales.\n\
      Esta clase comprende tambi\xC3\xA9n:\n\
      - la fabricaci\xC3\xB3n de hilo de papel.\n"
