    - "17 Industria del papel\n\
      Esta divisi\xC3\xB3n abarca la fabricaci\xC3\xB3n de pasta papelera, papel y productos de papel transformado. La fabricaci\xC3\xB3n de\n\
      estos productos se agrupa porque constituye una serie de procesos conectados verticalmente. Con frecuencia se\n\
      realiza m\xC3\xA1s de una actividad en la misma unidad.\n\
      Fundamentalmente se llevan a cabo tres actividades. La fabricaci\xC3\xB3n de pasta papelera consiste en separar las fibras\n\
      de celulosa de otros materiales en la madera, o en disolver y destintar el papel usado, y a\xC3\xB1adir a la mezcla peque\xC3\xB1as\n\
      cantidades de reactivos para reforzar la aglutinaci\xC3\xB3n de las fibras. La fabricaci\xC3\xB3n del papel comprende el vertido de\n\
      la pasta en una criba m\xC3\xB3vil con el fin de formar una hoja continua. Los productos de papel transformado se fabrican\n\
      con papel y otros materiales mediante diversas t\xC3\xA9cnicas.\n\
      Los art\xC3\xADculos de papel pueden estar impresos (papeles pintados, envoltorios para regalo, etc.), siempre que la\n\
      finalidad principal no sea la impresi\xC3\xB3n de informaci\xC3\xB3n.\n\
      La producci\xC3\xB3n de pasta papelera, papel y cart\xC3\xB3n a granel se incluye en el grupo 17.1, mientras que el resto de clases\n\
      comprende la producci\xC3\xB3n de papel y productos de papel sometidos a transformaciones ulteriores.\n"
