    - "18 Artes gr\xC3\xA1ficas y reproducci\xC3\xB3n de soportes grabados\n\
      Esta divisi\xC3\xB3n comprende la impresi\xC3\xB3n de peri\xC3\xB3dicos, libros, publicaciones peri\xC3\xB3dicas, impresos comerciales, tarjetas\n\
      de felicitaci\xC3\xB3n y otros materiales impresos, y las actividades complementarias asociadas, como la encuadernaci\xC3\xB3n,\n\
      los servicios de fotograbado y la representaci\xC3\xB3n en im\xC3\xA1genes de los datos. Las actividades complementarias\n\
      incluidas aqu\xC3\xAD forman parte integrante de la industria de la impresi\xC3\xB3n y estas operaciones en casi todos los casos\n\
      ofrecen un producto (una plancha para impresi\xC3\xB3n, un libre encuadernado o un disco o fichero inform\xC3\xA1tico) que forma\n\
      parte integrante de la industria de las artes gr\xC3\xA1ficas.\n\
      Entre los procedimientos que se utilizan en las artes gr\xC3\xA1ficas se encuentran una serie de m\xC3\xA9todos de transferencia\n\
      de im\xC3\xA1genes desde una plancha, pantalla o fichero inform\xC3\xA1tico a un soporte, como papel, pl\xC3\xA1stico, metal, art\xC3\xADculos\n\
      textiles o madera. Los m\xC3\xA9todos m\xC3\xA1s importantes consisten en la transferencia de la imagen desde una plancha o\n\
      pantalla al soporte por medio de la litograf\xC3\xADa, el huecograbado, la serigraf\xC3\xADa o la flexograf\xC3\xADa.\n\
      Aunque una sola unidad puede realizar la impresi\xC3\xB3n y la edici\xC3\xB3n (un peri\xC3\xB3dico, por ejemplo), cada vez es menos\n\
      frecuente que se lleven a cabo estas actividades diferenciadas en la misma ubicaci\xC3\xB3n f\xC3\xADsica.\n\
      Esta divisi\xC3\xB3n comprende tambi\xC3\xA9n la reproducci\xC3\xB3n de soportes grabados, como discos compactos, grabaciones de\n\
      v\xC3\xADdeo y programas inform\xC3\xA1ticos en discos o cintas, etc.\n\
      Esta divisi\xC3\xB3n no comprende las actividades de edici\xC3\xB3n (v\xC3\xA9ase la secci\xC3\xB3n J).\n"
