    - "26.20 Fabricaci\xC3\xB3n de ordenadores y equipos perif\xC3\xA9ricos\n\
      Esta clase comprende la fabricaci\xC3\xB3n y el montaje de ordenadores, como unidades centrales (mainframes),\n\
      ordenadores de sobremesa, ordenadores port\xC3\xA1tiles y servidores inform\xC3\xA1ticos, as\xC3\xAD como de perif\xC3\xA9ricos, como los\n\
      dispositivos de almacenamiento y de entrada y salida (impresoras, monitores, teclados). Los ordenadores pueden\n\
      ser anal\xC3\xB3gicos, digitales o h\xC3\xADbridos. Los digitales, que constituyen el tipo m\xC3\xA1s com\xC3\xBAn, son dispositivos que realizan la\n\
      totalidad de las siguientes tareas: (1) almacenan el programa o programas de procesamiento y los datos necesarios\n\
      para la ejecuci\xC3\xB3n del programa; (2) pueden programarse libremente con arreglo a los requisitos del usuario; (3)\n\
      realizan las operaciones aritm\xC3\xA9ticas especificadas por el usuario; y (4) ejecutan, sin intervenci\xC3\xB3n humana, un\n\
      programa de procesamiento que requiere que el ordenador modifique su ejecuci\xC3\xB3n mediante decisiones l\xC3\xB3gicas\n\
      durante la operaci\xC3\xB3n de procesamiento. Los ordenadores anal\xC3\xB3gicos son capaces de simular modelos matem\xC3\xA1ticos\n\
      y constan, al menos, de un control anal\xC3\xB3gico y elementos de programaci\xC3\xB3n.\n\
      Esta clase comprende:\n\
      - la fabricaci\xC3\xB3n de ordenadores de sobremesa\n\
      - la fabricaci\xC3\xB3n de ordenadores port\xC3\xA1tiles\n\
      - la fabricaci\xC3\xB3n de ordenadores centrales (mainframes)\n\
      - la fabricaci\xC3\xB3n de ordenadores de mano (p. ej., PDA)\n\
      - la fabricaci\xC3\xB3n de unidades de disco magn\xC3\xA9ticas, unidades de memoria flash y otros dispositivos de almacenamiento\n\
      - la fabricaci\xC3\xB3n de unidades de disco \xC3\xB3pticas (p. ej., CD-RW, CD-ROM, DVD-ROM, DVD-RW)\n\
      - la fabricaci\xC3\xB3n de impresoras\n\
      - la fabricaci\xC3\xB3n de monitores\n\
      - la fabricaci\xC3\xB3n de teclados\n\
      - la fabricaci\xC3\xB3n de todo tipo de ratones, joysticks y accesorios trackball\n\
      - la fabricaci\xC3\xB3n de terminales inform\xC3\xA1ticos especializados\n\
      - la fabricaci\xC3\xB3n de servidores inform\xC3\xA1ticos\n\
      - la fabricaci\xC3\xB3n de esc\xC3\xA1neres, incluidos los lectores de c\xC3\xB3digos de barras\n\
      - la fabricaci\xC3\xB3n de lectores de tarjetas inteligentes\n\
