    - "28 Fabricaci\xC3\xB3n de maquinaria y equipo n.c.o.p.\n\
      Esta divisi\xC3\xB3n comprende la fabricaci\xC3\xB3n de maquinaria y equipo que act\xC3\xBAa de manera independiente sobre los\n\
      materiales por medios mec\xC3\xA1nicos o t\xC3\xA9rmicos o realizan operaciones sobre los materiales (como manejo,\n\
      pulverizaci\xC3\xB3n, pesado o envasado), incluidos los componentes mec\xC3\xA1nicos que producen y aplican fuerza, y todas las\n\
      componentes primarias fabricadas especialmente. Esta divisi\xC3\xB3n comprende los dispositivos fijos, m\xC3\xB3viles o\n\
      manuales, tanto si se han dise\xC3\xB1ado para su utilizaci\xC3\xB3n en la industria o la construcci\xC3\xB3n como para uso agrario o\n\
      dom\xC3\xA9stico. La fabricaci\xC3\xB3n de equipos especiales para el transporte de pasajeros o mercanc\xC3\xADas dentro de locales\n\
      acotados corresponde tambi\xC3\xA9n a esta divisi\xC3\xB3n.\n\
      En esta divisi\xC3\xB3n se distingue entre la fabricaci\xC3\xB3n de maquinaria para usos espec\xC3\xADficos, es decir, la maquinaria para\n\
      un uso exclusivo en una industria o en un peque\xC3\xB1o conjunto de industrias de la NACE, y la maquinaria de uso\n\
      general, es decir aqu\xC3\xA9lla que se utiliza en una amplia gama de industrias de la NACE.\n\
      Esta divisi\xC3\xB3n comprende asimismo la fabricaci\xC3\xB3n de otra maquinaria para usos espec\xC3\xADficos no incluida en otros\n\
      apartados de la clasificaci\xC3\xB3n, sea utilizada o no en procesos de fabricaci\xC3\xB3n, como los equipos para atracciones de\n\
      feria, los equipos para boleras autom\xC3\xA1ticas, etc.\n\
      Esta divisi\xC3\xB3n no comprende la fabricaci\xC3\xB3n de productos met\xC3\xA1licos de uso general (divisi\xC3\xB3n 25), de dispositivos de\n\
      control asociados, de equipo inform\xC3\xA1tico, de equipos de medici\xC3\xB3n, ensayo y distribuci\xC3\xB3n de energ\xC3\xADa el\xC3\xA9ctrica y\n\
      aparatos de control (divisiones 26y 27) y de veh\xC3\xADculos de motor de uso general (divisiones 29 y 30).\n"
