    - "31 Fabricaci\xC3\xB3n de muebles\n\
      Esta divisi\xC3\xB3n comprende la fabricaci\xC3\xB3n de muebles y productos afines de cualquier material, excepto piedra,\n\
      hormig\xC3\xB3n y cer\xC3\xA1mica. Los procesos utilizados en la fabricaci\xC3\xB3n de muebles son m\xC3\xA9todos est\xC3\xA1ndar de elaboraci\xC3\xB3n de\n\
      materiales y montaje de componentes, incluidos los de corte, moldeo y laminaci\xC3\xB3n. El dise\xC3\xB1o del art\xC3\xADculo, para la\n\
      consecuci\xC3\xB3n de cualidades tanto est\xC3\xA9ticas como funcionales, constituye un aspecto importante del proceso de\n\
      producci\xC3\xB3n.\n\
      Algunos de los procesos empleados en la fabricaci\xC3\xB3n de muebles son similares a los utilizados en otros segmentos\n\
      de la manufactura. Por ejemplo, se llevan a cabo tareas de corte y montaje en la producci\xC3\xB3n de vigas trianguladas de\n\
      madera, que se clasifica en la divisi\xC3\xB3n 16 (Industria de la madera). Sin embargo, el conjunto de procesos aplicados\n\
      distinguen la fabricaci\xC3\xB3n de muebles de madera de la de productos de la madera. Del mismo modo, en la fabricaci\xC3\xB3n\n\
      de mobiliario met\xC3\xA1lico se utilizan t\xC3\xA9cnicas empleadas igualmente en la fabricaci\xC3\xB3n de productos laminados\n\
      clasificados en la divisi\xC3\xB3n 25 (Fabricaci\xC3\xB3n de productos met\xC3\xA1licos). El proceso de moldeo del mobiliario de material\n\
      pl\xC3\xA1stico es similar al que se aplica a otros productos de pl\xC3\xA1stico. Sin embargo, la fabricaci\xC3\xB3n de este tipo de muebles\n\
      tiende a ser una actividad especializada.\n"
