    - "33 Reparaci\xC3\xB3n e instalaci\xC3\xB3n de maquinaria y equipo\n\
      Esta divisi\xC3\xB3n comprende la reparaci\xC3\xB3n especializada de bienes producidos en el sector manufacturero con el objetivo\n\
      de procurar que la maquinaria, los equipos y otros productos vuelvan a funcionar. Se incluye asimismo la provisi\xC3\xB3n\n\
      de servicios de mantenimiento general o rutinario de estos productos para garantizar un funcionamiento eficaz y\n\
      evitar las aver\xC3\xADas y las reparaciones innecesarias.\n\
      Esta divisi\xC3\xB3n s\xC3\xB3lo comprende las actividades de reparaci\xC3\xB3n y mantenimiento especializadas. Una parte sustancial de\n\
      las reparaciones son efectuadas asimismo por los fabricantes de maquinaria, equipos y otros productos, en cuyo\n\
      caso, la clasificaci\xC3\xB3n de las unidades dedicadas a estas actividades de reparaci\xC3\xB3n y fabricaci\xC3\xB3n se lleva a cabo de\n\
      conformidad con el principio de valor a\xC3\xB1adido, que dar\xC3\xA1 lugar con frecuencia a la asignaci\xC3\xB3n de estas actividades\n\
      combinadas a la fabricaci\xC3\xB3n de art\xC3\xADculos. El mismo principio se aplica a la actividad combinada de comercio y\n\
      reparaci\xC3\xB3n.\n\
      La reconstrucci\xC3\xB3n o refabricaci\xC3\xB3n de maquinaria y equipos se considera una actividad de fabricaci\xC3\xB3n y se clasifica en\n\
      otras divisiones de esta secci\xC3\xB3n.\n\
      La reparaci\xC3\xB3n y el mantenimiento de art\xC3\xADculos que pueden ser utilizados como bienes de capital y como bienes de\n\
      consumo suele clasificarse como reparaci\xC3\xB3n y mantenimiento de enseres dom\xC3\xA9sticos (p. ej., reparaci\xC3\xB3n de mobiliario\n\
      de oficina y dom\xC3\xA9stico, v\xC3\xA9ase 95.24).\n\
      Se incluye asimismo en esta divisi\xC3\xB3n la instalaci\xC3\xB3n especializada de maquinaria. No obstante, la instalaci\xC3\xB3n de\n\
      equipos que constituyen una parte integral de edificios o estructuras similares, como la instalaci\xC3\xB3n de cableado\n\
      el\xC3\xA9ctrico, escaleras mec\xC3\xA1nicas o sistemas de aire acondicionado, se clasifica como construcci\xC3\xB3n.\n\
      Esta divisi\xC3\xB3n no comprende:\n\
      - la limpieza de maquinaria industrial (v\xC3\xA9ase 81.22)\n\
      - la reparaci\xC3\xB3n y el mantenimiento de ordenadores y equipos de comunicaci\xC3\xB3n (v\xC3\xA9ase 95.1)\n\
      - la reparaci\xC3\xB3n y el mantenimiento de enseres dom\xC3\xA9sticos (v\xC3\xA9ase 95.2)\n"
