    - "38.32 Valorizaci\xC3\xB3n de materiales ya clasificados\n\
      Esta clase comprende el procesado de residuos y chatarra met\xC3\xA1licos y no met\xC3\xA1licos para su transformaci\xC3\xB3n en\n\
      materias primas secundarias, generalmente mediante un proceso mec\xC3\xA1nico o qu\xC3\xADmico.\n\
      Tambi\xC3\xA9n comprende la recuperaci\xC3\xB3n de materiales procedentes de los ciclos de tratamiento de residuos por medio\n\
      de (1) la separaci\xC3\xB3n y clasificaci\xC3\xB3n de materiales recuperables procedentes de los ciclos de tratamiento de residuos\n\
      no peligrosos (es decir, basura) o (2) la separaci\xC3\xB3n y clasificaci\xC3\xB3n de materiales recuperables mezclados, como\n\
      papel, pl\xC3\xA1sticos, latas de bebidas usadas y metales, en distintas categor\xC3\xADas.\n\
      Algunos ejemplos de procesos de transformaci\xC3\xB3n mec\xC3\xA1nica o qu\xC3\xADmica que se efect\xC3\xBAan son:\n\
      - el molido mec\xC3\xA1nico de los residuos met\xC3\xA1licos procedentes de veh\xC3\xADculos usados, lavadoras, bicicletas, etc.\n\
      - la reducci\xC3\xB3n mec\xC3\xA1nica de grandes piezas de hierro, como vagones de ferrocarril\n\
      - la trituraci\xC3\xB3n de residuos de metal, veh\xC3\xADculos para desguace, etc.\n\
      - otros m\xC3\xA9todos de tratamiento mec\xC3\xA1nico, como el corte y la compresi\xC3\xB3n para reducir el volumen\n\
      - la regeneraci\xC3\xB3n de metales a partir de los residuos fotogr\xC3\xA1ficos, por ejemplo, del ba\xC3\xB1o fijador o las pel\xC3\xADculas y el\n\
      papel fotogr\xC3\xA1ficos.\n\
      - la recuperaci\xC3\xB3n del caucho, por ejemplo, neum\xC3\xA1ticos usados, para producir materias primas secundarias\n\
      - la clasificaci\xC3\xB3n y prensado de pl\xC3\xA1sticos para producir materias primas secundarias para tubos, tiestos, paletas y\n\
      similares\n\
      - la transformaci\xC3\xB3n (limpieza, fundici\xC3\xB3n, trituraci\xC3\xB3n) de residuos de pl\xC3\xA1stico o caucho en granulos\n\
      - la trituraci\xC3\xB3n, lavado y clasificaci\xC3\xB3n de vidrio\n\
      - la trituraci\xC3\xB3n, lavado y clasificaci\xC3\xB3n de otros residuos, como los de demolici\xC3\xB3n, para obtener materias primas\n\
      secundarias\n\
      - el procesado de aceites y grasas usados para cocinar para su transformaci\xC3\xB3n en materias primas secundarias\n\
      - la transformaci\xC3\xB3n de otros residuos procedentes de alimentos, bebidas y tabaco en materias primas secundarias\n"
