    - "43 Actividades de construcci\xC3\xB3n especializada\n\
      Esta divisi\xC3\xB3n comprende las actividades de construcci\xC3\xB3n especializada, es decir, la preparaci\xC3\xB3n y la construcci\xC3\xB3n de\n\
      partes de edificios y obras de ingenier\xC3\xADa civil. Estas actividades suelen estar especializadas en un aspecto com\xC3\xBAn a\n\
      diferentes estructuras y requieren la utilizaci\xC3\xB3n de t\xC3\xA9cnicas y equipos especiales. Se trata de actividades tales como\n\
      la hinca de pilotes, la cimentaci\xC3\xB3n, la erecci\xC3\xB3n de estructuras de edificios, el hormigonado, la colocaci\xC3\xB3n de ladrillo y\n\
      piedra, la instalaci\xC3\xB3n de andamios, la construcci\xC3\xB3n de cubiertas, etc. Se incluye la construcci\xC3\xB3n de estructuras de\n\
      acero, siempre que sus partes no sean fabricadas por la misma unidad. Las actividades de construcci\xC3\xB3n\n\
      especializada se realizan en su mayor\xC3\xADa mediante subcontrataci\xC3\xB3n, pero cuando se trata de trabajos de construcci\xC3\xB3n\n\
      destinados a la reparaci\xC3\xB3n se suele realizar directamente para el propietario.\n\
      Se incluyen asimismo las actividades de acabado de edificios.\n\
      Esta secci\xC3\xB3n comprende adem\xC3\xA1s la instalaci\xC3\xB3n de todo tipo de equipos que permiten que la construcci\xC3\xB3n funcione\n\
      como tal. Normalmente estas actividades se realizan a pie de obra, aunque algunas partes del trabajo pueden\n\
      llevarse a cabo en talleres especializados. Se incluyen actividades como la fontaner\xC3\xADa, la instalaci\xC3\xB3n de sistemas de\n\
      calefacci\xC3\xB3n y aire acondicionado, antenas, sistemas de alarma y otras instalaciones el\xC3\xA9ctricas, sistemas de\n\
      aspersi\xC3\xB3n autom\xC3\xA1tica contra incendios, ascensores y escaleras mec\xC3\xA1nicas, etc. Tambi\xC3\xA9n se incluyen los trabajos de\n\
      aislamiento (t\xC3\xA9rmico, sonoro y de humedad), chapister\xC3\xADa, refrigeraci\xC3\xB3n industrial, la instalaci\xC3\xB3n de sistemas de\n\
      iluminaci\xC3\xB3n y se\xC3\xB1alizaci\xC3\xB3n de carreteras, ferrocarriles, aeropuertos, puertos, etc. Tambi\xC3\xA9n se incluye la reparaci\xC3\xB3n\n\
      correspondiente a las actividades mencionadas.\n\
      Las actividades de acabado de edificios y obras son las que contribuyen al acabado o terminaci\xC3\xB3n de la\n\
      construcci\xC3\xB3n, como el acristalamiento, revocamiento, pintura, embaldosado y alicatado o el revestimiento con otros\n\
      materiales como el parqu\xC3\xA9, moqueta, papel pintado, etc., pulido de suelos, carpinter\xC3\xADa, sistemas ac\xC3\xBAsticos, limpieza\n\
      exterior, etc. Tambi\xC3\xA9n se incluye la reparaci\xC3\xB3n correspondiente a las actividades mencionadas.\n\
      El alquiler de equipos con operario se clasifica como la actividad de construcci\xC3\xB3n asociada a dichos equipos.\n"
