    - 2
    - "47 Comercio al por menor, excepto de veh\xC3\xADculos de motor y motocicletas\n\
      Esta divisi\xC3\xB3n comprende la reventa (venta sin transformaci\xC3\xB3n) de bienes nuevos y usados principalmente al p\xC3\xBAblico\n\
      en general para su consumo o utilizaci\xC3\xB3n personal o dom\xC3\xA9stica, en tiendas, grandes almacenes, puestos, empresas\n\
      de venta por correo, vendedores a domicilio, vendedores ambulantes, economatos, etc.\n\
      El comercio al por menor se clasifica en primer lugar seg\xC3\xBAn el punto de venta (comercio al por menor en\n\
      establecimientos: grupos 47.1 a 47.7; comercio al por menor no realizado en establecimientos: grupos 47.8 y 47.9).\n\
      El comercio al por menor en establecimientos comprende la venta al por menor de bienes de segunda mano\n\
      (clase 47.79). Dentro del comercio al por menor en establecimientos se hace otra distinci\xC3\xB3n entre el realizado en\n\
      establecimientos especializados (grupos 47.2 a 47.7) y el realizado en establecimientos no especializados\n\
      (grupo 47.1). Los grupos mencionados a su vez se subdividen seg\xC3\xBAn la gama de productos vendidos. El comercio\n\
      que no se realiza en establecimientos se subdivide de acuerdo con el tipo de comercio, como el realizado en puestos\n\
      de venta y en mercadillos (grupo 47.8) y otro comercio al por menor no realizado en establecimientos, por ejemplo,\n\
      por correo, a domicilio, en m\xC3\xA1quinas expendedoras, etc. (grupo 47.9).\n\
      Los bienes vendidos en esta divisi\xC3\xB3n se limitan a los denominados en general bienes de consumo o mercanc\xC3\xADas al\n\
      por menor.\n\
      En consecuencia, se excluyen los bienes que no suelen incluirse en el comercio al por menor, como los cereales, los\n\
      minerales, la maquinaria y equipos industriales, etc. Esta divisi\xC3\xB3n comprende tambi\xC3\xA9n las unidades que se dedican\n\
      fundamentalmente a la venta al p\xC3\xBAblico en general, a partir de la exposici\xC3\xB3n de la mercanc\xC3\xADa, de productos como los\n\
      ordenadores personales, material de escritorio, pintura o madera, aunque tales ventas pueden no ser para uso\n\
      personal o dom\xC3\xA9stico. La manipulaci\xC3\xB3n que suele realizarse vinculado a la actividad comercial no afecta al car\xC3\xA1cter\n\
      b\xC3\xA1sico de los productos y puede incluir, por ejemplo, la clasificaci\xC3\xB3n, la separaci\xC3\xB3n, la mezcla y el empaquetado.\n\
      Esta divisi\xC3\xB3n comprende tambi\xC3\xA9n el comercio al por menor realizado por intermediarios y las actividades de las\n\
      empresas de subastas al por menor.\n\
      Esta divisi\xC3\xB3n no comprende:\n\
      - la venta de productos agrarios por el responsable de la explotaci\xC3\xB3n (v\xC3\xA9ase la divisi\xC3\xB3n 01)\n\
      - la fabricaci\xC3\xB3n y venta de mercanc\xC3\xADas, que est\xC3\xA1 clasificada por lo general como fabricaci\xC3\xB3n en las divisiones 10-32\n\
      - la venta de veh\xC3\xADculos de motor, motocicletas y sus repuestos (v\xC3\xA9ase la divisi\xC3\xB3n 45)\n\
      - el comercio de cereales, minerales, crudo de petr\xC3\xB3leo, productos qu\xC3\xADmicos industriales, hierro y acero y la\n\
      maquinaria y equipo industriales (v\xC3\xA9ase la divisi\xC3\xB3n 46)\n\
      - la venta de alimentos y bebidas para su consumo en el mismo local y venta de comida para llevar (v\xC3\xA9ase la\n\
      divisi\xC3\xB3n 56)\n\
      - el alquiler de art\xC3\xADculos de uso personal y dom\xC3\xA9stico al p\xC3\xBAblico en general (v\xC3\xA9ase 77.2)\n"
