    - "64.30 Inversi\xC3\xB3n colectiva, fondos y entidades financieras similares\n\
      Esta clase comprende las personas jur\xC3\xADdicas constituidas para la mancomunidad de valores u otros activos\n\
      financieros, sin gestionarlos, en nombre de accionistas o beneficiarios. Las carteras se adaptan para obtener\n\
      caracter\xC3\xADsticas de inversi\xC3\xB3n espec\xC3\xADficas, como diversificaci\xC3\xB3n, riesgo, tasa de rentabilidad y volatilidad de precios.\n\
      Estas entidades obtienen intereses, dividendos y otras rentas de la propiedad, pero su n\xC3\xBAmero de empleados es\n\
      escaso o nulo, y no obtienen ingresos por la venta de servicios.\n\
      Esta clase comprende:\n\
      - fondos de inversi\xC3\xB3n abiertos (open-end)\n\
      - fondos de inversi\xC3\xB3n cerrados (close-end)\n\
      - fondos de inversi\xC3\xB3n colectiva (unit investment trust funds)\n\
      - fideicomisos, herencias o cuentas de agencia, administrados en nombre de los beneficiarios bajo un contrato de\n\
      fideicomiso, testamento o contrato de agencia\n\
      - entidades que piden fondos prestados con el \xC3\xBAnico objetivo de prestarlos a su matriz directa o indirecta (conduits)\n"
