    - "72 Investigaci\xC3\xB3n y desarrollo\n\
      Esta divisi\xC3\xB3n comprende tres tipos de actividades relativas a la investigaci\xC3\xB3n y el desarrollo: 1) la investigaci\xC3\xB3n\n\
      b\xC3\xA1sica: trabajo experimental o te\xC3\xB3rico emprendido con el fin primordial de adquirir nuevos conocimientos sobre las\n\
      causas profundas de fen\xC3\xB3menos y hechos observables, sin pretender una aplicaci\xC3\xB3n o utilizaci\xC3\xB3n determinada, 2) la\n\
      investigaci\xC3\xB3n aplicada: investigaci\xC3\xB3n original emprendida con objeto de adquirir nuevos conocimientos y encaminada\n\
      fundamentalmente hacia una finalidad u objetivo pr\xC3\xA1ctico espec\xC3\xADfico, y 3) el desarrollo experimental: trabajo\n\
      sistem\xC3\xA1tico basado en conocimientos previos obtenidos por investigaci\xC3\xB3n o por experiencia pr\xC3\xA1ctica, encaminado a\n\
      la producci\xC3\xB3n de nuevos materiales, productos o aparatos, a la implantaci\xC3\xB3n de nuevos procesos, sistemas y\n\
      servicios y a la mejora sustancial de lo que ya se produce o est\xC3\xA1 utiliz\xC3\xA1ndose.\n\
      Las actividades de investigaci\xC3\xB3n y desarrollo experimental de este apartado se subdividen en dos categor\xC3\xADas:\n\
      ciencias naturales y t\xC3\xA9cnicas; ciencias sociales y humanidades.\n\
      Esta divisi\xC3\xB3n no comprende:\n\
      - los estudios de mercado (v\xC3\xA9ase 73.20)\n"
